  false,\n\t\"url\": null,\n\t\"notes\": \"Task plan from the U.S. Geological Survey
  for sampling Lake Ladora on the Rocky Mountain National Wildlife Refuge. During
  the review of the FY93 Surface-Water Monitoring Program, February 24, 1993, the
  EPA suggested that some sampling of Lake Ladora might be appropriate in order to
  investigate the relation between the Lake and unconfined ground-water north and
  east of Lake Ladora. Program Manager of Rocky Mountain Arsenal  tentatively agreed
  to this suggestion and, after a follow-up meeting on March 17, 1993, it was decided
  to prepare the following plan. The Lake Ladora Sampling Plan, described here, sets
  forth the work and procedures that will be used to conduct this synoptic investigation.\",\n\t\"license_title\":
